import React, { useState } from "react";

const Username = () => {
  const [username, setUsername] = useState("Ahsan");
  return (
    <div>
      <h1>Username</h1>
      <input
        type="text"
        value={username}
        onChange={() => setUsername(username)}
      />
    </div>
  );
};

export default Username;
